var gameReadContract = undefined
var researchReadContract = undefined;
var factoryReadContract = undefined;
var troopReadContract = undefined;
var missionReadContract = undefined;
var planetReadContract = undefined;
var lootReadContract = undefined;
var warzoneReadContract = undefined;

var gameWriteContract = undefined;
var missionWriteContract = undefined;
var researchWriteContract = undefined;

$( document ).ready(function() {
    initializeWalletState(function(){
		initialize();
	});

	$( "#accountView" ).click(function() {
		location.href = "sample.html";
	});

	$( "#connectWalletView" ).click(function() {
  		connectToMetamask();
	});

	setTimeout(function(){ 
		dismissLoader();
	}, 3000);
});

async function initialize() {
	//Initialize Contracts.
	//Read: Reading data from blockchain
	//Write: Writing data to blockchain via MetaMask

	planetReadContract = new readerWeb3.eth.Contract(
     PlanetContractABI,
     PlanetContractAddress
  );
	gameReadContract = new readerWeb3.eth.Contract(
     GameContractABI,
     gameContractAddress
  );
  gameWriteContract = new writerWeb3.eth.Contract(
     GameContractABI,
     gameContractAddress
  );
  researchReadContract = new readerWeb3.eth.Contract(
     ResearchContractABI,
     ResearchContractAddress
  );
  factoryReadContract = new readerWeb3.eth.Contract(
     FactoryContractABI,
     FactoryContractAddress
  );
  lootReadContract = new readerWeb3.eth.Contract(
      LootContractABI,
      LootContractAddress
  );
  missionReadContract = new readerWeb3.eth.Contract(
     MissionContractABI,
     MissionContractAddress
  );
  missionWriteContract = new writerWeb3.eth.Contract(
     MissionContractABI,
     MissionContractAddress
  );

  troopReadContract = new readerWeb3.eth.Contract(
     TroopContractABI,
     TroopContractAddress
  );
  researchWriteContract = new writerWeb3.eth.Contract(
     ResearchContractABI,
     ResearchContractAddress
  );
  warzoneReadContract = new readerWeb3.eth.Contract(
    WarzoneContractABI,
    WarzoneContractAddress
   );

  loadPage();
	if (typeof window.ethereum !== 'undefined') {
    window.ethereum.on('chainChanged', function(chainId){
      loadPage();
    });
  }
}

function accountChanged(){
	loadPage();
}

async function loadPage(){
  try {
    readerWeb3.eth.clearSubscriptions();

    showStats();
  }catch(error){
    console.log(error);
  }
}

function displayResult(result){
	dismissLoader();
	document.getElementById("result").innerHTML = result;
}


async function showStats(){
	var stats = await gameReadContract.methods.getStats().call();
	var planetCount = stats[0];
	var structureUpgradedCount = stats[1];

	var result = planetCount + " planets minted.";
	result += "\n" + structureUpgradedCount + " sctructures upgraded.";
	displayResult(result);
}

async function loadPlanets(){
	if(selectedAccount == undefined){
		return;
	}
	showLoader();

	var tokenIds = await planetReadContract.methods.tokensOfOwner(Web3.utils.toChecksumAddress(selectedAccount)).call();
	retrieveMetadatas(tokenIds, function(planets){
		displayResult(JSON.stringify(planets));
		dismissLoader();
	});
	
	if(tokenIds.length == 0){
		dismissLoader();
	}
}


function retrieveMetadatas(tokenIds, callback){
	var metadatas = [];
	for(var i=0; i < tokenIds.length; i++){
		var tokenId = tokenIds[i];
		metadatas.push({});
	}

	var count = tokenIds.length;
	if(count == 0){

		callback([]);
		return;
	}
	for(var i=0; i < tokenIds.length; i++){
		var tokenId = tokenIds[i];
		retrieveMetadata(i, tokenId, function(index, result){
			metadatas[index] = result;
			count -= 1;
			if(count <= 0){
				callback(metadatas);
				return;
			}
		})
	}
}

