			var availableSoldierList = availableSoldierIds[Number(troopMeta.id)];
			var allSpaceshipList = allSpaceshipIds[Number(troopMeta.id)];
			var availableSpaceshipList = availableSpaceshipIds[Number(troopMeta.id)];

			if(allSoldierList !== undefined && allSoldierList.length>0){
				var availableCount = 0;
				if(availableSoldierList !== undefined){
					availableCount = availableSoldierList.length;
				}
				selectableTroops.push({
					image: "https://s3.eu-central-1.amazonaws.com/novaxgame.com/"+troopMeta.image,
					count: availableCount,
					name: troopMeta.name
				});
			}
